	SELECT
		a.asset_id
	FROM
		data.assets a
	LEFT JOIN
		(SELECT asset_id FROM data.assets_antecedant GROUP BY asset_id) b
	USING 
		(asset_id)
	WHERE 
		b.asset_id is null
)
SELECT 
	no_data_yet.asset_id,
	seed.seven_day*(random() *0.2 + 0.9) as seven_day, 
	seed.thirty_day*(random() *0.2 + 0.9) as thirty_day,
